  false,\n\t\"url\": null,\n\t\"notes\": \"WISCONSIN_GLACIAL_LIMIT_IN.shp is a line
  shapefile that shows the Wisconsin glacial limit in Indiana as delineated by mapped
  glacial deposits at a scale of 1:500,000. The mapped units include glacial till
  that is interpreted to have been deposited during the Wisconsin Glaciation. The
  last major expansion of the North American Laurentide Ice Sheet occured in the Wisconsin
  glacial episode.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
